import React, {Component} from 'react';
import { DatePicker } from 'antd';
import 'antd/dist/antd.css';
class AddItem extends Component{
    constructor(props){
        super(props)
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    render(){
        return (
            <div>
            <h3>Add Item</h3>
            <form onSubmit={this.handleSubmit}>
                <table>
                    <thead></thead>
                    <tbody>
                        <tr><td>ig_handle</td><td><input type='text' required="required"/></td></tr>
                        <tr><td>image</td><td><input type="url" required="required"/></td></tr>
                        <tr><td>content</td><td><textarea></textarea></td></tr>
                        <tr>
                            <td>type</td>
                            <td>
                                <select>
                                    <option value=''>*</option>
                                    <option value='storage'>storage</option>
                                    <option value='living'>living</option>
                                    <option value='dining'>dining</option>
                                    <option value='bedroom'>bedroom</option>
                                    <option value='other'>other</option>
                                </select>
                            </td>
                        </tr>
                        <tr><td>date</td><td><input type='date'/></td></tr>
                    </tbody>
                </table>
            <input type="submit" value="Submit" /> <span>please complete the form</span>
            </form>
        </div>
        )
    }
    handleSubmit(event) {
        console.log(event)
    }
}
export default AddItem;
